import styles from './styles.module.scss';
import Link from 'next/link';
import Button from '../../shared/button'


function Contact() {
    return(
        <>
            <div className={styles.bottom_note}>
                <p>Thanks for scrolling.</p>
                <button 
                    text = 'Next Project'
                    downArrow = 'false'
                    url = '/home'
                />
            </div>
        </>
    )
}

export default Contact;
